.modal__container {
  background-color: #fff;
  padding: 24px;
  max-width: 600px;
  width: 100%;
  border-radius: 4px;
  overflow-y: auto;
  box-sizing: border-box;
  box-shadow: 0px 11px 15px -7px rgba(0, 0, 0, 0.2), 0px 24px 38px 3px rgba(0, 0, 0, 0.14), 0px 9px 46px 8px rgba(0, 0, 0, 0.12);
